import React from 'react';
import { Link } from 'react-router-dom';

const SignInLinks = () => {
    return (
        <ul className='right'>
            <li><Link to='/'>CreateProject</Link></li>
            <li><Link to='/'>Log Out</Link></li>
            <li><Link className='btn btn-floating pink lighten-1'>KK</Link></li>
        </ul>
    )
}

export default SignInLinks;
